import numpy as np
import matplotlib.pyplot as plt
import scipy.stats as stats
import pandas as pd
import pickle

random_data = data1
with open(f'10000_games_data_20240814_180746.pkl', 'rb') as f:
    data = pickle.load(f)
    expectimax_data = data['value_target'][:, 0]

# Create a figure for the histograms
plt.figure(figsize=(16, 8))

# Plot histograms with more refined aesthetics
plt.hist(random_data, bins=50, color='skyblue', alpha=0.7, density=True, edgecolor='black', label='Random Data')
plt.hist(expectimax_data, bins=50, color='salmon', alpha=0.7, density=True, edgecolor='black', label='Expectimax Data')

# Add KDE manually with finer line settings
kde_random_data = stats.gaussian_kde(random_data)
kde_expectimax_data = stats.gaussian_kde(expectimax_data)

x_vals = np.linspace(0, 300, 1000)
plt.plot(x_vals, kde_random_data(x_vals), color='blue', lw=2.5, linestyle='--', label='KDE Random Data')
plt.plot(x_vals, kde_expectimax_data(x_vals), color='red', lw=2.5, linestyle='--', label='KDE Expectimax Data')

# Add grid, titles, and labels
plt.grid(True, linestyle='--', alpha=0.6)
plt.title('Data Histograms with KDE Overlay', fontsize=20, weight='bold')
plt.xlabel('Value', fontsize=16)
plt.ylabel('Density', fontsize=16)
plt.legend(fontsize=14)

# Display the histogram
plt.show()

plt.figure(figsize=(16, 8))
plt.hist(expectimax_data, bins=50, color='salmon', alpha=0.7, edgecolor='black', label='Expectimax Data')
plt.plot(x_vals, kde_expectimax_data(x_vals), color='red', lw=2.5, linestyle='--', label='KDE Expectimax Data')
plt.show()

# Calculate and display statistics
mean_random = np.mean(random_data)
mean_expectimax = np.mean(expectimax_data)
std_random = np.std(random_data)
std_expectimax = np.std(expectimax_data)
median_random = np.median(random_data)
median_expectimax = np.median(expectimax_data)
max_random = np.max(random_data)
max_expectimax = np.max(expectimax_data)

statistics = {
    'Statistic': ['Mean', 'Median', 'Max Value', 'Standard Deviation'],
    'Random Data': [mean_random, median_random, max_random, std_random],
    'Expectimax Data': [mean_expectimax, median_expectimax, max_expectimax, std_expectimax]
}

# Convert the statistics to a DataFrame for better display
stats_df = pd.DataFrame(statistics)

# Display the DataFrame
print(stats_df)

# Create a figure for the boxplots
plt.figure(figsize=(12, 6))

# Create boxplots for both datasets
plt.boxplot([random_data, expectimax_data], patch_artist=True, notch=True,
            boxprops=dict(facecolor='skyblue', color='blue'),
            medianprops=dict(color='red', linewidth=2),
            whiskerprops=dict(color='blue', linewidth=2),
            capprops=dict(color='blue', linewidth=2),
            flierprops=dict(marker='o', color='blue', alpha=0.5))

# Add titles and labels
plt.title('Boxplots of the different Algorithms', fontsize=18, weight='bold')
plt.xticks([1, 2], ['Random Data', 'Expectimax Data'], fontsize=14)
